import Swal from 'sweetalert2'
import { AuthContext } from "../Auth/AuthContext";
import { Card, FormControl, InputGroup } from "react-bootstrap"

export const Equip = () => {

  const [correo, setcorreo] = useState("")

  const {
    user: { nameproy },
    dispatch
  } = useContext(AuthContext)

  console.log({nameproy})


  return (
    <>
      <span className="nav-item nav-link text-info">{nameproy}</span>
      <div align="center">
        <Card
          bg="dark"
          text="white"
        >
          <Card.Header as="h5">Agregar usuario al equipo</Card.Header>
