                  onChange={(e) => {
                    setcorreo(e.target.value);
                  }}
                />
              </InputGroup>
            </Card.Title>
            <Card.Text>
              <button className='btn btn-prime btn-block'>
                Agregar
              </button>

            </Card.Text>
          </Card.Body>
        </Card>
      </div>


    </>
  );
}
